import React from 'react';
import Login from './Login';

const VerAgricultor = ({nombres, apellidos }) => {
  return (
    <div>
      <p>Nombre :{nombres}</p> 
      <p>Apellido :{apellidos}</p>
    </div>
  )
}

export default VerAgricultor
